import './App.css';
import Main from "../Main/Main";
import Header from "../Header/Header";
import { Route } from "react-router-dom";
import Movies from "../Movies/Movies";

function App() {
  return (
    <div>
        <Header />
        <Route exact path="/">
          <Main />
        </Route>
        <Route path="/movies">
          <Movies />
        </Route>
    </div>
  );
}

export default App;
